""" Rabin-Karp Algorithm

算法首先计算target hash值，
再通过第一个m个字符source的hash值辗转计算接下来的值，
每次计算完成与target hash值进行比较
（source: n，target: m）

Algorithm:
第一组字符hash值采用经典算法，题128
之后每组hash值可用以下算法求得：
推导1：h(abc) = h(ab) * 31 + c
推导2：h(bc) = h(abc) - a * 31 ^ 2

Note：
1. 如何判断循环截止？
整个source字符串进行循环，遇到前m位的计算就continue
2. hash值结果为负数？
当推导2中减去的最后一项非常大时，有可能发生结果为负，例如，target很长导致幂次方非常大
解决方法为加上一个Hash Base使其为正，回环结构
3. 多个相同子串？
(假如需要构建hash table，没必要构造hash table，利用hash的思想找到子串直接比大小）
dict中key为字符子串，value为子串位置
python中的dict会把这类相同key值对合并为一个，但是用最新的key替换旧key
test_case2 输出结果应为1，而不是合并后的结果：5
所以将判断放进循环内，保证第一次找到子串对应hash就返回
4. 万一是哈希碰撞呢？
最后整个比较子字符
5. 一定要做negative test
处理找了一圈没有找到的情况
6. 超时的情况
当子串非常大时是有可能超时的，power是非常大的数
# 31 ** m = 31 ** 100 !!very large value
提前计算power并对其循环取模
7. 为什么 j < m -1?
故意漏掉一次让abc可以和hash_tar进行比较
否则就没有做比较直接continue了

Complexity:
O(m)算出target hash
O(n - m)次循环求得hash table
O(m)验证正确性

O(n) + O(m）= O(m) + O(n - m) + O(m)
"""


class Solution:
    """
    @param source: source string to search
    @param target: target string
    @return pos: position of first occurrence
    """
    def strStr_RKA(self, source, target):
        if source is None or target is None:
            return -1

        m, n = len(target), len(source)
        # S   T
        # ''  ''  0
        # 'a' ''  0
        if m == 0:
            return 0

        # S    T
        # ''  'a'  -1
        if n == 0 and m != 0:
            return -1

        HASH_BASE = 1000000
        power = 1
        hash_tar = 0
        for i in range(m):
            hash_tar = (hash_tar * 31 + ord(target[i])) % HASH_BASE
            # m = 10000...see Note.6
            power = (31 * power) % HASH_BASE

        hash_src = 0
        # abc + d
        for j in range(n):
            hash_src = (hash_src * 31 + ord(source[j])) % HASH_BASE
            # brilliant trick, see Note.7
            # abc + d
            if j < (m - 1):
                continue

            # abcd - a
            if j >= m:
                hash_src = (hash_src - ord(source[j - m]) * power) % HASH_BASE
                # see Note.2
                if hash_src < 0:
                    hash_src += HASH_BASE

            # see Note.4
            if hash_src == hash_tar:
                if source[j - m + 1:j + 1] == target:
                    return j - m + 1

        # see Note.5
        return -1


# lets write some test cases
sol = Solution()
test_src1 = 'abcde'
test_tar1 = 'cd'

test_src2 = 'abcdabcdefg'
test_tar2 = 'bcd'

test_src3 = 'tartarget'
test_tar3 = 'target'

test_src4 = ""
test_tar4 = ""

neg_test_src = 'source'
neg_test_tar = 'target'


print(sol.strStr_RKA(test_src3, test_tar3))

